import React from 'react'
import Typed from 'react-typed'
export default function home() {
    return (
        <div>
        <div className="main-info">
        <Typed 
            className ="typed-text"
            strings = {["Nike Shows" , "Nike Sondal" , "Men's running Shoes" , "Men's Shoes & Sneakers" , "Kid's Shoes"]}
            typeSpeed = {40}
            backSpeed = {60}
            loop
        />
        </div>
        </div>
    )
}
